import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
	    <h1>Beau's</h1>
	    <h2>Thank you for your time with me</h2>
      </div>
    );
  }
}

export default App;
